import React, { Component } from "react";
import "./Myintencion.css"



class Myintencion extends Component {
    constructor(props) {
        super(props);
        this.state = {
            showgrave: this.props.showgrave,
            showmydata: this.props.showmydata,
            showmyintencion: this.props.showmyintencion
        }



    }
    componentDidMount = () => {
        axios.get(this.props.store.backendadress + '/inten/myintecion', { params: { Ovner: this.props.user } })
            .then(res => {
                console.log(res.data)
            }
            )
    }


    render() {

        return (
            <></>
        )


    }

}

export default Myintencion
